DROP TABLE IF EXISTS `sys_calendar`;

CREATE TABLE `sys_calendar` (
  `c_date` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '自然日日期',
  `c_type` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否为工作日 0-工作日 1-假日 2-节日',
  `c_typename` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '日期描述',
  `c_yearname` varchar(4) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '年份',
