/* Procedure structure for procedure `init100000` */

/*!50003 DROP PROCEDURE IF EXISTS  `init100000` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `init100000`( IN `startNum` INT, IN `endNum` INT )
BEGIN#Routine body goes here...
	DECLARE
		i INT;
	DECLARE
		s INT;
	
	SET i = startNum;
	WHILE
			i >= startNum AND i <= endNum DO
		SELECT
			COUNT(*) INTO s 
		FROM
			t_order 
		WHERE
			order_id = i;
		IF
			s = 0 THEN
				INSERT INTO t_order ( order_id )
			VALUES
				( i );
			
		END IF;
		
		SET i = i + 1;
		
	END WHILE;
	SELECT concat('i= ', i);

END */$$
DELIMITER ;

